import axios from 'axios'
import React, { useState } from 'react'

function CurrencyConvert() {
    const [convert,setConvert]=useState({})

    const handleChange=(event)=>{
        setConvert(event.target.value)
    }
    const handleClick=()=>{
        // const url='http://api.openrates.io/latest'
        axios({
            url: 'http://api.openrates.io/latest',
            method: 'get',
            headers: {
                'X-Id-Token': 'abc123abc123',
                'Content-Type': 'application/json'
            }
         })
        .then((response)=>{
            console.log(response.data)
        })
        .catch((error)=>{
            console.log(error)
        })
    }
    return (
      <div>
          <input type='text' onChange={handleChange} placeholder='Enter currency' value={convert.name} name='INR' ></input>
        <button onClick={handleClick} >InrToDoller</button>
      </div>
    );
  }
  
  export default CurrencyConvert;
